import React from "react";
import { Container,
    HomeIcon,
    SendIcon,
    CompassIcon,
    HeartIcon, } from "./sRouteIcons";
const RouteIcons = () => {
    return (
        <Container>
            <HomeIcon />
            <SendIcon />
            <CompassIcon />
            <HeartIcon />
        </Container>
    );
};

export default RouteIcons;
